import React from 'react';
import { PostcodeForm } from '../pages/Form/PostcodeForm';
import Header from '../Framework/Header/Header';
//import { DataBuilder } from '../pages/DataBuilder/DataBuilder';
import Wrapper from '../utils/Wrapper';
//import classes from './Layout.module.css';

//Layout function component
const Layout = ({ history }: { history?: History }) => {

    const onSubmitPostcode= (val:string)=> {
        history?.push("/models")    }
    return (
        <Wrapper>
            <Header headerName= {"Postcode finder"}/>
            <PostcodeForm onSubmitPostcode = {onSubmitPostcode}/>
            {/*<div className={classes.Content}>
                <DataBuilder />
    </div>*/}
        </Wrapper>
    );

};
export default Layout;
